import Tilt from 'react-tilt';




const Instructions = () => {
  return (

    <div className='ma4 mt0'>

      <Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 100, width: 100 }} >
        <div className="Tilt-inner pa3"> <p>How to play?</p> </div>
      </Tilt>

    </div>

  );
}

export default Instructions;
